import { StyleSheet, Text, View, ScrollView } from "react-native";
import React,{useState,useEffect} from "react";
import CardAsset from "./Card";
import { useUser } from "./UserContext";
import axios from "axios";


const HistoryPage = ({navigation}) => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const { username } = useUser()

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(`https://b6b4-149-140-157-40.ngrok-free.app/analyzes`, {
          params: {
            username: username
          },
        });
        setData(Object(response.data));

        console.log(response.data)
      } catch (error) {
        console.error('Error fetching data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  return (
    <ScrollView>
        {
          data ? (
          data.map((d)=>{
            return(<CardAsset
              key={d.id}
              healthy={d.healthy}
              hypodontia={d.hypodontia}
              calculus={d.calculus}
              gingivitis={d.gingivitis}
              tooth_decay={d.tooth_decay}
              description={d.description}
              image={d.image}
              createdAt={d.created_at}
            />) 
          })
          ) : (
            <View style={styles.centeredTextContainer}>
              <Text style={styles.centeredText}>Analiz BulunamadÄ±.</Text>
            </View>
          )
        }
    </ScrollView>
  );
};

export default HistoryPage;

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  centeredTextContainer: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
  centeredText: {
    fontSize: 18,
    textAlign: "center",
    marginTop: 20,
  },
});
